import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import './MyBookings.css';

const MyBooking = () => {
  const [mybookings, setmybookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showReviewForm, setShowReviewForm] = useState(false);
  const [rating, setRating] = useState(5);
  const [reviewText, setReviewText] = useState('');
  const { driverId } = useParams(); // Get driverId from URL parameters

  useEffect(() => {
    const fetchmybookings = async () => {
      try {
        const response = await axios.get('http://localhost:3002/api/booking/bookings/user', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`, // Use token from local storage or context
          },
        });
        setmybookings(response.data);
      } catch (error) {
        console.error('Error fetching bookings:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchmybookings();
  }, []);

  const handleReviewClick = () => {
    setShowReviewForm(true);
  };

  const handleReviewSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        `http://localhost:3002/api/reviews/${driverId}`,
        { rating, reviewText },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`, // Use token from local storage or context
          },
        }
      );
      console.log('Review submitted:', response.data);
      setShowReviewForm(false);
    } catch (error) {
      console.error('Error submitting review:', error);
    }
  };

  return (
    <div className="mybooking-container">
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="mybooking-list">
          {mybookings.length > 0 ? (
            mybookings.map((mybooking) => (
              <div key={mybooking._id} className="mybooking-item">
                <h3>Hire: {mybooking.hire?.departure} to {mybooking.hire?.arrival}</h3>
                <p><strong>Seats Booked:</strong> {mybooking.seatsBooked}</p>
                <p><strong>Date:</strong> {new Date(mybooking.hire?.date).toLocaleDateString()}</p>
                <p><strong>Vehicle Type:</strong> {mybooking.hire?.vehicleType}</p>

                <div className="button">
                  <button className="actionButton" onClick={handleReviewClick}>Add review</button>
                </div>
              </div>
            ))
          ) : (
            <p>No bookings found.</p>
          )}
        </div>
      )}

      {showReviewForm && (
        <div className="review-popup">
          <div className="review-popup-content">
            <h2>Add a Review</h2>
            <form onSubmit={handleReviewSubmit}>
              <label>
                Rating:
                <select value={rating} onChange={(e) => setRating(e.target.value)}>
                  <option value="1">1</option>
                  <option value="2">2</option>
                  <option value="3">3</option>
                  <option value="4">4</option>
                  <option value="5">5</option>
                </select>
              </label>
              <label>
                Review:
                <textarea value={reviewText} onChange={(e) => setReviewText(e.target.value)} />
              </label>
              <button type="submit">Submit Review</button>
              <button type="button" onClick={() => setShowReviewForm(false)}>Cancel</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default MyBooking;
